import NavBar from './components/NavBar.jsx'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router,Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Route exact path="/">
          home page
        </Route>
        <Route exact path="/about">
          about page
        </Route> 
        <Route exact path="/about">
          about page
        </Route>        
      </Router>
    </div>
  );
}

export default App;
